import React from 'react';
import './App.css';
import photo1 from './roll_1/398049_0001.jpg';
import photo2 from './roll_1/398049_0006.jpg';
import photo3 from './roll_1/398049_0007.jpg';
import photo4 from './roll_1/398049_0013.jpg';
import photo5 from './roll_1/398049_0021.jpg';
import photo6 from './roll_1/398049_0023.jpg';
import photo7 from './roll_1/398049_0027.jpg';
import photo8 from './roll_1/398049_0032.jpg';

export default class HomePhotos extends React.Component {
  render () {

    return (
        <div className="container">
            <div className="row">
                <img src={photo1} height={400}></img>
                <img src={photo4} width={400} height={600}></img>
                <img src={photo8} height={400}></img>
            </div>
            <div className="row">
                <img src={photo3} width={400} height={600}></img>
                <img src={photo5} height={400}></img>
                <img src={photo7} width={400} height={600}></img>
            </div>
            <div className="row">
                <img src={photo2} height={400}></img>
                <img src={photo6} height={400}></img>
            </div>
        </div>
    )
  }
}
